import React from 'react';
import '../User.css';
import {Navbar, Container, Nav} from 'react-bootstrap';
import { Link } from 'react-router-dom';

function Navigation() {
    return (
        <div>
            <Navbar bg="dark" variant="dark" fixed="sticky">
                <Container>
                    <Navbar.Brand href="http://evolute.in" className="navbarbrand"></Navbar.Brand>
                    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                    <Navbar.Collapse id="responsive-navbar-nav">
                        <Nav className="ml-auto">
                            <Nav.Link><Link to="/User/KeyRequest">Key Request</Link></Nav.Link>
                            <Nav.Link><Link to="/User/KeyDownload">Key Download</Link></Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar> 
        </div>
    )
}

export default Navigation;
